import React from 'react'




const LogoSearch = () => {
  return (
    <div className="LogoSearch">
         <div className="logoname">Virtual Club</div>
        <div className="search">
            <input type='text' placeholder='#Explore'/>
        </div>
    </div>
    
  )
}

export default LogoSearch
